import logo from './logo.svg';
import './App.css';
import Header from "./components/Header/Header";
import Banner from "./components/Banner/Banner";
import News from "./components/News/News";
import Footer from "./components/Footer/Footer";

function App() {
  return (
    <div className="App">
      <Header />
        <Banner />
        <News />
      <Footer />

    </div>
  );
}

export default App;
